const drawMap = () => {
    const map_container = document.querySelector('.map__container')
    const mansions = document.querySelector('.map__mansions').textContent.trim().split(',')

    map_container.setAttribute('id', 'map')
    map_container.style.height = '600px'

    if (map) {
        map.remove();
    }
    var map = L.map('map').setView([52.3727598, 4.8936041], 13);

    const osmLayer = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>'
    }).addTo(map);
    osmLayer.getContainer().style.filter = 'invert(100%) brightness(60%) contrast(120%)';

    mansions.forEach(m => {
        const coord = m.split('|')[0]
        const link = m.split('|')[1]
        const icon = m.split('|')[2]
        L.marker(coord.split(';'), {
            icon: L.divIcon({
                html: icon,
                className: "emoji-marker",
                iconSize: [30, 30]
            })
        }).addTo(map)
            .bindPopup(link)
    });
}

window.addEventListener('DOMContentLoaded', drawMap);// check the content of the title tag to detect a page change
const title = document.querySelector("title");
const observer = new MutationObserver(() => {
    if (document.title == 'Homepage' && !window._mapInitialized) {
        window._mapInitialized = true;
        drawMap();
    }
});
observer.observe(title, { childList: true });
